import Cookies from 'js-cookie';
import { useNavigate } from 'react-router-dom';

function Account() {

    const [cookies,setCookies] = useCookies()
    const navigate = useNavigate()

    const cookieDetails = Cookies.get('Cookie')
    console.log("Cooookies",cookieDetails)

    if(cookieDetails) {
        useEffect(() => {
        const parsedCookie = JSON.parse(cookieDetails)
        console.log('Cookieeeee' , parsedCookie.token)
        const decodedToken = jwt_decode(parsedCookie.token)
        console.log("Decoded Token", decodedToken.email)
        if(decodedToken) {
            navigate("/account")
            return
        }
        })

        // else {
        //     navigate("/login")
        // }

    }
    else{
        navigate("/login")
    }


    // if(decodedToken.email) {
    //     navigate("/account")
    // }


    function handleLogout() {

            setCookies('Cookie' , '')


       navigate("/")
    }

    return(
        <div>
            <h1>Account</h1>
            <input type='file' />
            <button>Upload</button>
            <button onClick={handleLogout}>Logout</button>
        </div>

    )
}

export default Account
